import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [response, setResponse] = useState('');
  const [loading, setLoading] = useState(false);

  // Example: Send answers to backend stress-check endpoint
  const handleStressCheck = async () => {
    setLoading(true);
    try {
      const res = await fetch('http://127.0.0.1:5000/api/stress-check', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ answers: [1, 2, 1, 0, 2] }) // Example answers
      });
      const data = await res.json();
      setResponse(data.result);
    } catch (err) {
      setResponse('Error connecting to backend.');
    }
    setLoading(false);
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h2>MindCare Demo</h2>
        <button onClick={handleStressCheck} disabled={loading}>
          {loading ? 'Checking...' : 'Run Stress Check'}
        </button>
        {response && <p>{response}</p>}
      </header>
    </div>
  );
}

export default App;
